import React, { useState } from "react";
import CartItem from "./CartItem";

function CartItemsList({ selectUser, userCartItems }){

  let subtotal = 0;

  function updateSubtotal(price) {
    subtotal = subtotal + parseInt(price);
    console.log(subtotal);
  }

  return(
    <div className="cart-list">
      {userCartItems.map((cartItem) => <CartItem key={cartItem.id} item={cartItem} updateSubtotal={updateSubtotal}/>)}
      {console.log}
    </div>
  )
}

export default CartItemsList;
